import "./App.css";
import SingleCell from "./components/SingleCell";
import CreateReservation from "./components/CreateReservation";
import CancelReservation from "./components/CancelReservation";

import { BrowserRouter, Routes, Route } from "react-router-dom";

const table = [
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
  null,
];

function App() {
  return (
    <div className="App d-flex">
      <div className="grow3 d-flex flex-wrap">
        {table.map((x, i) => (
          <SingleCell key={i} item={x} />
        ))}
      </div>
      <div className="grow1">
        <CreateReservation />
        <CancelReservation />
      </div>
    </div>
  );
}

export default App;
